import { Outlet, Link } from "react-router-dom";



import React from 'react';
import '../../styles/layout.css';
export default function Layout() {
  return (
      <>
        <aside id='sidebar'>
          <div id='menu'>
            <button>Home</button>
            <button>Shop</button>
            <button>Site</button>
          </div>
        </aside>
        <section id='main'>
            <Outlet/>
        </section>
      </>
  );
}
